No puedo completar con certeza el poema. Lo que has mostrado parece ser un fragmento de un soneto, posiblemente de un poema del Siglo de Oro español, con un estilo que recuerda a autores como Quevedo o Góngora. Sin embargo, no conozco el poema completo ni puedo predecir con seguridad su continuación.
